(function (w, d) {

    "use strict";

    var Vyrus = Vyrus || function(opts) {

        var cache = {
                id: "vyrus",
                cyrus: "data:image/png;base64,",
                

                audio: {
                	mp3: {
	                	annoying: "data:audio/mp3;base64,",
	                	dumbstep: "data:audio/mp3;base64,",
	                },
	                ogg: {
	                	annoying: "data:audio/ogg;base64,",
	                	dumbstep: "data:audio/ogg;base64,"
	                },
                },

                styles: ""
            },

            utils = {
                css: {
                    load: function(fn){
                        var img = d.createElement('img');
                        img.onload = function(){
                            cache.imgWidth = img.width;
                            cache.imgHeight = img.height;
                            fn.call();
                        };
                        img.src = cache.cyrus;
                    },
                    format: function(styles){
                        var k,
                            css = '';
                        for(k in styles){
                            var animation = (k && k[0] === "@") ? true : false,
                                term = (animation) ? '' : ';';
                            css += k+"{"+styles[k].join(term)+"}\n";
                        }
                        
                        return css;
                        
                    },
                    styles: function(){
                        var styleEl = d.getElementById(cache.id+'-styles');
                        if(!styleEl){
                            var s = d.createElement('style');
                            s.setAttribute('type', 'text/css');
                            s.setAttribute('id', cache.id+'-styles');
                            d.getElementsByTagName('head')[0].appendChild(s);
                            styleEl = d.getElementById(cache.id+'-styles');
                        }
                        styleEl.innerHTML = (cache.styles);
                    }
                },
                audio: {
                    playAudio: function(opts){
                
                        var player = utils.audio.getPlayer(),
                        	format = player.canPlayType('audio/mp3') ? 'mp3' : 'ogg',
                        	audio = cache.audio[format][opts.audio] || false;
                        if(audio){
                            player.src = audio;
                            if(opts.loop){
                                player.loop = true;
                            }
                            if(opts.finished){
                                player.addEventListener('ended', opts.finished);
                            }
                            if(opts.autoplay){
                                player.play();
                            }
                        }
                        return player;
                    },
                    getPlayer: function() {
                        var container = utils.audio.getContainer(), 
                            player, 
                            players = container.getElementsByTagName("audio");
                        
                        for (player in players) {
                            if (player.currentTime === 0 || player.ended) {
                                return player;
                            }
                        }
                    
                        player = d.createElement("audio");
                        container.appendChild(player);
                        return player;
                    },
                    getContainer: function() {
                        var container = d.getElementById(cache.id);
                        
                        if (container === null) {
                            container = d.createElement("div");
                            container.id = cache.id;
                            d.getElementsByTagName('body')[0].appendChild(container);
                        }
                    
                        return container;
                    }
                },
                kill: function(){
                    d.getElementById(cache.id).innerHTML = '';
                    cache.html.className = (cache.html.className).replace("infecting");
                }
            },
            events = {
                keydown: function(){
                    d.addEventListener('keydown', function(e){
                        var which = e.which;
                        if(e.which===27){
                            utils.kill();
                        }
                    });
                }
            },

            init = function(opts){

                events.keydown();
                
                utils.css.load(function(){
                
                    cache.styles = utils.css.format({
                        'html.infecting': [
                            '-webkit-animation: color 1s infinite linear',
                            '-moz-animation: color 1s infinite linear',
                            'animation: color 1s infinite linear'
                        ],
                        '.infecting .head': [
                            'position: fixed',
                            'z-index: 99999',
                            'top: 50%',
                            'left: 50%',
                            'margin-top: -'+(cache.imgHeight/2)+'px',
                            'margin-left: -'+(cache.imgWidth/2)+'px',
                            '-webkit-animation: head 1s infinite linear',
                            '-moz-animation: head 1s infinite linear',
                            'animation: head 1s infinite linear'
                        ],
                        '.infecting .rainbow': [
                            'position: fixed',
                            'z-index: 99999',
                        ],
                        '.infecting .rainbow span': [
                            'background-image:-webkit-gradient( linear, left top, right top, color-stop(0, #f22), color-stop(0.15, #f2f), color-stop(0.3, #22f), color-stop(0.45, #2ff), color-stop(0.6, #2f2),color-stop(0.75, #2f2), color-stop(0.9, #ff2), color-stop(1, #f22) )',
                            'background-image:-moz-gradient( linear, left top, right top, color-stop(0, #f22), color-stop(0.15, #f2f), color-stop(0.3, #22f), color-stop(0.45, #2ff), color-stop(0.6, #2f2),color-stop(0.75, #2f2), color-stop(0.9, #ff2), color-stop(1, #f22) )',
                            'color:transparent',
                            '-webkit-background-clip: text',
                            '-moz-background-clip: text',
                            'font-weight: bold',
                            'font-size: 36px'
                        ],
                        '.firefox.infecting .rainbow span': [
                            'color:limegreen'
                        ],
                        '.tl, .tr, .bl, .br': [ 'position: fixed' ],
                        '.tl': [ 'top: 10px', 'left: 10px' ],
                        '.tr': [ 'top: 10px', 'right: 10px' ],
                        '.bl': [ 'bottom: 10px', 'left: 10px' ],
                        '.br': [ 'bottom: 10px', 'right: 10px' ],
                        '@-webkit-keyframes color': [
                          '0%   { -webkit-filter: hue-rotate(0deg); }',
                          '50%  { -webkit-filter: hue-rotate(180deg); }',
                          '100% { -webkit-filter: hue-rotate(360deg); }',
                        ],
                        '@-moz-keyframes color': [
                          '0%   { -moz-filter: hue-rotate(0deg); }',
                          '50%  { -moz-filter: hue-rotate(180deg); }',
                          '100% { -moz-filter: hue-rotate(360deg); }'
                        ],
                        '@keyframes color': [
                          '0%   { filter: hue-rotate(0deg); }',
                          '50%  { filter: hue-rotate(180deg); }',
                          '100% { filter: hue-rotate(360deg); }',
                        ],
                        '@-webkit-keyframes head': [
                          '0%   { -webkit-transform: scale(0.9) rotate(0deg); }',
                          '50%  { -webkit-transform: scale(1.2) rotate(180deg); }',
                          '100% { -webkit-transform: scale(0.9) rotate(360deg); }',
                        ],
                        '@-moz-keyframes head': [
                          '0%   { -moz-transform: scale(0.9) rotate(0deg); }',
                          '50%  { -moz-transform: scale(1.2) rotate(180deg); }',
                          '100% { -moz-transform: scale(0.9) rotate(360deg); }'
                        ],
                        '@keyframes head': [
                          '0%   { transform: scale(0.9) rotate(0deg); }',
                          '50%  { transform: scale(1.2) rotate(180deg); }',
                          '100% { transform: scale(0.9) rotate(360deg); }',
                        ]
                    });
                    
                    utils.css.styles();
                    
                    utils.audio.playAudio({
                        audio: 'annoying', 
                        loop: false, 
                        autoplay: true, 
                        finished: function(){
                            
                            cache.html = d.getElementsByTagName('html')[0];
                            
                            cache.html.className += " infecting";
                        	
                            if(navigator.userAgent.indexOf('Firefox')!==-1){
		                    	cache.html.className+=" firefox";
		                    }
                        	
                            utils.audio.playAudio({
                                audio: 'dumbstep',
                                loop: true,
                                autoplay: true
                            });
                            
                            // Add Head
                            var image = d.createElement('img');
                            image.src = cache.cyrus;
                            image.className = "head";
                            utils.audio.getContainer().appendChild(image);
                            
                            // Add Text
                            var text = d.createElement('div');
                            text.className = "rainbow";
                            text.innerHTML = [
                                '<span class="tl">Do you feel it?</span>',
                                '<span class="tr">Uhhh, Trance Rox</span>',
                                '<span class="bl">Thats Cool Bro</span>',
                                '<span class="br">Turn me up DJ</span>'
                            ].join('');
                            utils.audio.getContainer().appendChild(text);
                            
                        }
                    });
                });
                
            };
            
            init();
        };

    this.Vyrus = Vyrus;

}).call(this, window, document);
